(1, 'Mark javitch', 'Javitch', 'Mark Javitch', 'javitchm@gmail.com', 'sparkpost', 'stripe', 'sk_live_2stcUuz1Z6M839BnoO5WNxib', 'pk_live_Ukm21tCSOpDie6OwrlBaDopP', '8mZ3L7nc', '64c9Zf83ap5W5kH4', '<p>My name is Tom Pereira I have been in the fitness industry since 1988 , with 27 years of experience in the personal training field I had the privilege to work with one of the best trainers and professionals competitors in Sao Paulo ,Brazil. Since the beginning of my carries I always had the passion to teach and preach my knowledge. I Arrived in U.S.A. IN THE 90&rsquo;S where had the pleasure to work and train with some of the best in the business ,always searching for the innovation and improvements that could be made on different types of workouts.</p>\n', 'Working with diverse type of clients we got to perfect ionize our techniques and our way to work . Since 2013 my wife and busisness partner IFBB figure Pro got together to creat our company Prolifters Fitness specialist  that continues to grow every day .\nAs a professional trainer I enjoy working with clients that are wiling to work hard so I can use my fitness knolege to help them to transform their bodies.\n', 'http://www.neo-crews.com/E_commision/admin/assets/profile_img/ec78fc66b9866c9da1ac37b3976baec8.jpg', 'F381BDAFFBCAFF8A2DDE4E84F0FB4201', '', 1, NULL, NULL, NULL, 1, '00fb333cec7935b44002d1e26d95bfef', '4bfa263ad2eacb0534660325c37ffb00', 1511177304, '', 1537353327);
